<style
    module
    lang="scss"
>
.CartModal {
    display: flex;
    flex-direction: column;
    height: 100%;

    @include respond-to(t) {
        min-width: 413px;
    }
}

.title {
    @include heading(heading-6);

    display: flex;
    align-items: center;
    justify-content: space-between;
    flex-shrink: 0;
    margin-bottom: 24px;
}

.cartList {
    overflow: auto;
    display: flex;
    flex-direction: column;
    gap: 16px;
    flex: 1 1 auto;
    height: 200px;
}

.shoppingCard {
    background: $neutral-02;
}

.summary {
    flex-shrink: 0;
    padding-top: 8px;
    background: $base;
    text-align: center;
}

.subtotal,
.total {
    display: flex;
    justify-content: space-between;
    padding: 12px 0;
}

.subtotal {
    @include text(body-2);

    border-bottom: 1px solid $neutral-03;

    *:last-child {
        @include text(body-2, semi);
    }
}

.total {
    @include heading(heading-7);
}

.linkToCart {
    margin-top: 16px;
}
</style>
